import { GetUserTokenService } from './GetUserTokenService'
import { GetUserTokenUseCase } from './GetUserTokenUseCase'

function createGetUserTokenUseCase(getUserTokenService: GetUserTokenService): GetUserTokenUseCase {
  return function () {
    return getUserTokenService()
  }
}

export { createGetUserTokenUseCase }
